import React from "react";
import Row from 'common/components/Row';
import Col from 'common/components/Col';
import FormControl from "common/components/FormControl";
import TextInput from "common/components/TextInput";

const UserInfo = (formProps: {register, errors}) => {
    return (
        <Row>
            <Col>
                <FormControl>
                    <label>First Name</label>
                    <TextInput name="firstName" ref={formProps.register}/>
                    {/*{formProps.errors.firstName && formProps.errors.firstName.message}*/}
                </FormControl>
                <FormControl>
                    <label>Last Name</label>
                    <TextInput name="lastName" ref={formProps.register}/>
                    {/*{formProps.errors.lastName && formProps.errors.lastName.message}*/}
                </FormControl>
                <FormControl>
                    <label>Nickname</label>
                    <TextInput name="nickname" ref={formProps.register}/>
                    {/*{formProps.errors.nickname && formProps.errors.nickname.message}*/}
                </FormControl>
            </Col>
            <Col>
                <FormControl>
                    <label>Congenital Disease</label>
                    <TextInput name="conDisease" ref={formProps.register}/>
                    {/*{formProps.errors.conDisease && formProps.errors.conDisease.message}*/}
                </FormControl>
                <FormControl>
                    <label>Allergic food</label>
                    <TextInput name="allergicFood" ref={formProps.register}/>
                    {/*{formProps.errors.allergicFood && formProps.errors.allergicFood.message}*/}
                </FormControl>
            </Col>
        </Row>
    )
}

export default UserInfo;
